        <Box
            sx={{
                width: "100%",
                height: "100%",
                background: "linear-gradient(45deg, #fca61f, #f3f3f3)",
                borderRadius: "10px",
                padding: "10px",
                display: "flex",
                flexDirection: "column",
                justifyContent: "space-between",
                alignItems: "center",
            }}
        >
        </Box>

    )

}

export default ProfileCard;
